import React from "react";
import styled from "styled-components";
import TodoItem from "./TodoItem";

const StyleTodo = styled.div`
    border: 1px solid red;
    width: 800px;
    height: 1000px;
    margin: auto;
    margin-top: 150px;
    display: flex;
`;

const AllTodo = styled.div`
    margin: auto;
    margin-top: 50px;
    margin: 20px;
`;

const Input = styled.form``;

const Todo = () => {
    return (
        <StyleTodo>
            <AllTodo>
                <Input>
                    <input></input>
                    <button>Enter</button>
                </Input>
                <div>
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                </div>
            </AllTodo>
        </StyleTodo>
    );
};

export default Todo;
